    false,nt"url": null,nt"notes": "A continuation of the recreational fishing
    program has been proposed for St. Vincent National Wildlife Refuge to follow the
    guidelines of the attached fishery management plan. Justification for a recreational
    fishing program on St. Vincent NWR is provided by (1) the area's present fisheries
    resource, and (2) stable demand for public sport fishing opportunity in an area
    that has been historically used as such. The lake system on St. Vincent NWR supports
